Insert into ACCO_ROOMS (ROOM_NO,ROOM_NAME,ROOM_NUMBERS,ROOM_CAPACITY,ROOM_DAY_PRICE,ROOM_DESCRIPTION,ACCO_ID,ROOM_THUMBNAIL_IMAGE) values (365108,'페미리룸(안방)',3,2,140000,'안방은 우리집에서 가장 큰 방으로 부엌하고 붙어있어 음식이 필요한 모임이나 행사를 진행하기 좋습니다. 안방만 저녁에도 취사가 가능하기 때문에 늦게까지 친목이 필요하신 경우에 추천합니다. 할머니가 수십 년 동안 그때그때 생활에 맞게 수선한 방으로 전통 한옥의 느낌보다는 시골 외할머니 방 같은 소박한 느낌의 방입니다. 마루턱이 다른 방에 비해 낮고 쇼파가 있어 어린아이나, 어르신, 다리가 불편하신 분들이 이용하기 좋습니다.',11254,'11254-365108-4.jpg');
