Insert into ACCO_ROOMS (ROOM_NO,ROOM_NAME,ROOM_NUMBERS,ROOM_CAPACITY,ROOM_DAY_PRICE,ROOM_DESCRIPTION,ACCO_ID,ROOM_THUMBNAIL_IMAGE) values (397515,'독채형',3,3,340000,'복합한옥공간 곳은 종로구 계동에 위치(안국역도보 5분거리)해 있으며 근처에는 경복궁, 창덕궁, 창경궁,인사동,국립현대 미술관 그리고 많은분들이 찾는 카페들도 즐비합니다. ''곳''은 현대의 감각과 한국 전통이 모두 살아 숨쉬는 곳으로 마당에는 40년 이상된 산수유 나무가 있고 그 아래에는 작은 정원이 있어 4계절 다양한 모습을 보실수 있습니다. 또한 저희는 친환경적인 삶을 지향하기 위해 사용되는 소모품 및 아침 조식 또한 친환경으로 제공합니다.',53084,'53084-397515-4.jpg');
